import { Fragment, useEffect } from 'react';
import MainNavigation from './MainNavigation';
import Aos from "aos";
import "aos/dist/aos.css";
const Layout = (props) => {
  useEffect(() => {
    Aos.init({ duration: 1500 });
  }, []);
  return (
    <Fragment>
      <MainNavigation />
      <main>{props.children}</main>
    </Fragment>
  );
};

export default Layout;
